import React from 'react';
import './Streambox.css';

import cover from './Data/cover.jpg'

function Streamer() {
    return (
        <div className="Stream_outerbox">
            <div className="album_cover">
                <img alt='song_cover' src={cover} height/>
            </div>
            <div className="song_detail">
                <h1 id="song_title">Under the Tree</h1>
                <h2 id='descrip'>SIMs, NUEKI</h2>
            </div>
            <div className="controls">
                <input type="range" min="1" max="1000" value="50" id="range" class="slider" />
                <button id='Button'>A</button>
            </div>
        </div>
    );
}

export default Streamer;
